    );

const appendContact = () => {
  const temp = {id:10, fullName: "Name10", phone: "+44 368 435", notes: "Note10"};
  items.push(temp);
  console.log(items.length);

}

  return (
    <div className='container mt-5'>
        <div className='card'> 
          <div className='card-header'>
            <h1>Contact List</h1>
          </div>
          <div className='card-body'>
            <TableView data = {items} />
            <div>
              <button 
              className='btn btn-primary'
              onClick={appendContact}>
                New contact
              </button>

            </div>
          </div>
        </div>
       </div>

  );
}

export default App;
